    [],nt"revision_timestamp": "2016-01-09T11:51:42.492118",nt"name": "juvenile-rockfish-recruitment-cruise",nt"isopen":
    false,nt"url": null,nt"notes": "In 1983, the groundfish analysis project
    began a series of yearly cruises designed to assess the annual abundance of juvenile
    rockfish along the central California coast.  Midwater trawls were collected and
    CTDs performed during late spring of every year since 1983.  Initially the cruises
    were restricted to the San Francisco area; however, in the early 2000's, the geographic
    range was extended to include San Diego through Fort Bragg.",nt"license_title":
